const project03 = {
  title: "VQA-Net",
  image: "./images/projects/project03/vqanet.jpg",
  explanation:
    "U-Net is a network for semanitc segmentation. With this network we try to segment data of Camvid dataset and a significant result on it. Our final accuracy after 30 epochs of training was 82.3%.",
  paper: null,
  github: "https://github.com/ahedayat/VQA-Net"
};
export default project03;
